(function () {
  var module = angular.module('loom_add_server_directive', []);
  module.directive('loomAddServer', [
    'serverService',
    '$translate',
    '$rootScope',
    'dialogService',
    'mapService',
    function (serverService, $translate, $rootScope, dialogService, mapService) {
      return {
        templateUrl: 'addlayers/partials/addserver.tpl.html',
        link: function (scope, element) {
          scope.serverService = serverService;
          scope.loading = false;
          scope.reset = function () {
            scope.type = 'WMS';
            scope.name = null;
            scope.url = null;
            scope.editing = false;
            scope.server = null;
          };
          scope.reset();
          scope.addServer = function (info) {
            var config = {
                name: info.name,
                url: info.url
              };
            if (info.type === 'TMS') {
              config.ptype = 'gxp_tmssource';
              if (goog.isDefAndNotNull(config.url) && config.url.lastIndexOf('/') !== config.url.length - 1) {
                config.url += '/';
              }
            } else {
              config.ptype = 'gxp_wmscsource';
            }
            scope.loading = true;
            serverService.addServer(config).then(function (server) {
              scope.loading = false;
              $rootScope.$broadcast('server-added-through-ui', server.id);
              scope.reset();
              element.closest('.modal').modal('hide');
            }, function () {
              scope.loading = false;
              dialogService.error($translate.instant('error'), $translate.instant('failed_to_add_server'), [$translate.instant('btn_ok')]);
            });
          };
          scope.getPattern = function () {
            return new RegExp('');
          };
          scope.getPlaceholder = function () {
            if (scope.type === 'WMS') {
              return 'http://url/geoserver/wms';
            } else if (scope.type === 'TMS') {
              return 'http://url/1.0.0/';
            }
          };
          scope.editServer = function () {
            scope.server.name = scope.name;
            if (goog.isDefAndNotNull(scope.server.config)) {
              scope.server.config.name = scope.name;
            }
            if (scope.server.url !== scope.url) {
              var layers = mapService.getLayers(true, true);
              for (var index = 0; index < layers.length; index++) {
                if (layers[index].get('metadata').serverId == scope.server.id) {
                  dialogService.error($translate.instant('server'), $translate.instant('remove_layers_first'), [$translate.instant('btn_ok')]);
                  element.closest('.modal').modal('hide');
                  scope.reset();
                  return;
                }
              }
              dialogService.warn($translate.instant('server'), $translate.instant('edit_server'), [
                $translate.instant('yes_btn'),
                $translate.instant('no_btn')
              ], false).then(function (button) {
                switch (button) {
                case 0:
                  scope.server.url = scope.url;
                  scope.loading = true;
                  var doWork = function () {
                    serverService.populateLayersConfig(scope.server, true).then(function () {
                      scope.loading = false;
                      element.closest('.modal').modal('hide');
                      scope.reset();
                    }, function () {
                      scope.loading = false;
                      element.closest('.modal').modal('hide');
                      scope.reset();
                    });
                  };
                  dialogService.promptCredentials(scope.server.url, false).then(function (credentials) {
                    scope.server.username = credentials.username;
                    scope.server.authentication = $.base64.encode(credentials.username + ':' + credentials.password);
                    var serverBaseUrl = removeUrlLastRoute(server.url);
                    var serverAuthenticationUrl = serverBaseUrl + '/rest/settings.json';
                    serverAuthenticationUrl = serverAuthenticationUrl.replace('http://', 'http://null:null@');
                    ignoreNextScriptError = true;
                    $.ajax({
                      url: serverAuthenticationUrl,
                      type: 'GET',
                      dataType: 'jsonp',
                      jsonp: 'callback',
                      error: function () {
                        ignoreNextScriptError = false;
                      },
                      complete: doWork
                    });
                  }, function (reject) {
                    scope.server.username = $translate.instant('anonymous');
                    scope.server.authentication = undefined;
                    doWork();
                  });
                }
              });
            } else {
              element.closest('.modal').modal('hide');
              scope.reset();
            }
          };
          var parentModal = element.closest('.modal');
          var closeModal = function (event, element) {
            if (parentModal[0] === element[0]) {
              scope.reset();
            }
          };
          scope.$on('modal-closed', closeModal);
          scope.$watch('type', function () {
            if (!scope.editing) {
              scope.url = null;
            }
          });
          scope.$on('server-edit', function (event, server) {
            element.closest('.modal').modal('show');
            if (server.ptype == 'gxp_tmssource') {
              scope.type = 'TMS';
            } else if (server.ptype == 'gxp_wmscsource') {
              scope.type = 'WMS';
            }
            scope.editing = true;
            scope.name = server.name;
            scope.url = server.url;
            scope.server = server;
          });
        }
      };
    }
  ]);
}());
(function () {
  var module = angular.module('loom_layerinfo_popover_directive', []);
  module.directive('loomLayerinfoPopover', [
    '$translate',
    function ($translate) {
      return {
        restrict: 'C',
        replace: false,
        link: function (scope, element) {
          var safeName = function () {
            if (goog.isDefAndNotNull(scope.layer.Name)) {
              var split = scope.layer.Name.split(':');
              return split[split.length - 1];
            }
            return '';
          };
          var safeTitle = function () {
            if (goog.isDefAndNotNull(scope.layer.Title)) {
              return scope.layer.Title;
            }
            return '';
          };
          var safeWorkspace = function () {
            if (goog.isDefAndNotNull(scope.layer.Name)) {
              var split = scope.layer.Name.split(':');
              return split[0];
            }
            return '';
          };
          var safeAbstract = function () {
            if (goog.isDefAndNotNull(scope.layer.Abstract)) {
              return scope.layer.Abstract;
            }
            return '';
          };
          var buildKeywords = function () {
            if (goog.isDefAndNotNull(scope.layer.KeywordList)) {
              return scope.layer.KeywordList.toString();
            }
            return '';
          };
          var content = '<div class="popover-label">' + $translate.instant('server_name') + ':</div>' + '<div class="popover-value">' + safeName() + '</div>' + '<div class="popover-label">' + $translate.instant('title') + ':</div>' + '<div class="popover-value">' + safeTitle() + '</div>' + '<div class="popover-label">' + $translate.instant('workspace') + ':</div>' + '<div class="popover-value">' + safeWorkspace() + '</div>' + '<div class="popover-label">' + $translate.instant('abstract') + ':</div>' + '<div class="popover-value">' + safeAbstract() + '</div>' + '<div class="popover-label">' + $translate.instant('keywords') + ':</div>' + '<div class="popover-value">' + buildKeywords() + '</div>';
          element.popover({
            trigger: 'manual',
            animation: false,
            html: true,
            content: content,
            container: 'body',
            title: scope.layer.title
          });
          element.mouseenter(function () {
            if (element.closest('.collapsing').length === 0) {
              element.popover('show');
            }
          });
          element.mouseleave(function () {
            element.popover('hide');
          });
          scope.$watch('layer', function () {
            element.popover('destroy');
            var content = '<div class="popover-label">' + $translate.instant('server_name') + ':</div>' + '<div class="popover-value">' + safeName() + '</div>' + '<div class="popover-label">' + $translate.instant('title') + ':</div>' + '<div class="popover-value">' + safeTitle() + '</div>' + '<div class="popover-label">' + $translate.instant('workspace') + ':</div>' + '<div class="popover-value">' + safeWorkspace() + '</div>' + '<div class="popover-label">' + $translate.instant('abstract') + ':</div>' + '<div class="popover-value">' + safeAbstract() + '</div>' + '<div class="popover-label">' + $translate.instant('keywords') + ':</div>' + '<div class="popover-value">' + buildKeywords() + '</div>';
            element.popover({
              trigger: 'manual',
              animation: false,
              html: true,
              content: content,
              container: 'body',
              title: scope.layer.title
            });
          });
        }
      };
    }
  ]);
}());
