(function () {
  var module = angular.module('loom_refresh_service', []);
  var mapService_ = null;
  var dialogService_ = null;
  var historyService_ = null;
  var translate_ = null;
  var notificationService_ = null;
  var geogitService_ = null;
  var featureDiffService_ = null;
  var service_ = null;
  var timeout_ = null;
  module.provider('refreshService', function () {
    this.$get = [
      'mapService',
      '$translate',
      'notificationService',
      'geogitService',
      'historyService',
      'dialogService',
      'featureDiffService',
      function (mapService, $translate, notificationService, geogitService, historyService, dialogService, featureDiffService) {
        mapService_ = mapService;
        notificationService_ = notificationService;
        geogitService_ = geogitService;
        historyService_ = historyService;
        dialogService_ = dialogService;
        translate_ = $translate;
        featureDiffService_ = featureDiffService;
        service_ = this;
        timeout_ = setTimeout(function () {
          refresh(mapService);
        }, 60000);
        return this;
      }
    ];
    this.autoRefresh = true;
    function refresh(mapService) {
      if (service_.autoRefresh) {
        var refreshed = {};
        var notRefreshed = {};
        var layers = mapService.getLayers();
        var refreshTimeout = 60000;
        if (!goog.isDefAndNotNull(layers)) {
          if (goog.isDefAndNotNull(timeout_)) {
            clearTimeout(timeout_);
          }
          timeout_ = setTimeout(function () {
            refresh(mapService);
          }, refreshTimeout);
          return;
        }
        if (!goog.isArray(layers)) {
          layers = [layers];
        }
        if (layers.length < 1) {
          if (goog.isDefAndNotNull(timeout_)) {
            clearTimeout(timeout_);
          }
          timeout_ = setTimeout(function () {
            refresh(mapService);
          }, refreshTimeout);
          return;
        }
        var doDiff = function (repoChange, metadata) {
          var options = new GeoGitDiffOptions();
          options.oldRefSpec = repoChange.oldId;
          options.newRefSpec = repoChange.newId;
          options.showGeometryChanges = true;
          options.show = 50;
          options.pathFilter = metadata.nativeName;
          geogitService_.command(repoChange.repoid, 'diff', options).then(function (diffResponse) {
            if (!goog.isDefAndNotNull(diffResponse.Feature)) {
              return;
            }
            var notificationText = '';
            var featureList = null;
            if (goog.isDef(diffResponse.nextPage)) {
              notificationText = metadata.title;
            } else {
              var added = 0, modified = 0, removed = 0;
              featureList = [];
              forEachArrayish(diffResponse.Feature, function (feature) {
                featureList.push(feature);
                switch (feature.change) {
                case 'ADDED':
                  added++;
                  break;
                case 'MODIFIED':
                  modified++;
                  break;
                case 'REMOVED':
                  removed++;
                  break;
                }
              });
              if (featureList.length !== 0) {
                notificationText = '';
                if (added > 0) {
                  notificationText += added + ' ' + translate_.instant('added');
                  if (modified > 0 || removed > 0) {
                    notificationText += ', ';
                  }
                }
                if (modified > 0) {
                  notificationText += modified + ' ' + translate_.instant('modified');
                  if (removed > 0) {
                    notificationText += ', ';
                  }
                }
                if (removed > 0) {
                  notificationText += removed + ' ' + translate_.instant('removed');
                }
                notificationText += ' ' + translate_.instant('in_lower_case') + ' ' + metadata.title;
              } else {
                featureList = null;
              }
            }
            mapService.dumpTileCache(metadata.uniqueID);
            historyService_.refreshHistory(metadata.uniqueID);
            notificationService_.addNotification({
              text: notificationText,
              read: false,
              type: 'loom-update-notification',
              emptyMessage: translate_.instant('too_many_changes_refresh', { value: 50 }),
              repos: [{
                  name: metadata.geogitStore,
                  features: featureList
                }],
              callback: function (feature) {
                var logOptions = new GeoGitLogOptions();
                logOptions.firstParentOnly = true;
                logOptions.path = feature.original.id;
                logOptions.show = 1;
                logOptions.until = metadata.branchName;
                logOptions.since = repoChange.newId;
                var doFeatureDiff = function (commitId) {
                  featureDiffService_.undoable = true;
                  featureDiffService_.leftName = 'old';
                  featureDiffService_.rightName = 'new';
                  featureDiffService_.setFeature(feature.original, repoChange.oldId, commitId, repoChange.oldId, null, repoChange.repoid);
                  $('#feature-diff-dialog').modal('show');
                };
                geogitService_.command(metadata.repoId, 'log', logOptions).then(function (response) {
                  if (goog.isDefAndNotNull(response.commit)) {
                    dialogService_.warn(translate_.instant('warning'), translate_.instant('newer_feature_version'), [
                      translate_.instant('yes_btn'),
                      translate_.instant('no_btn')
                    ], false).then(function (button) {
                      switch (button) {
                      case 0:
                        doFeatureDiff(response.commit.id);
                        break;
                      case 1:
                        doFeatureDiff(repoChange.newId);
                        break;
                      }
                    });
                  } else {
                    doFeatureDiff(repoChange.newId);
                  }
                }, function (reject) {
                });
              }
            });
          });
        };
        var processLayer = function (layer, nextIndex) {
          var nextLayer = function (idx) {
            if (layers.length > idx) {
              processLayer(layers[idx], idx + 1);
            } else {
              if (goog.isDefAndNotNull(timeout_)) {
                clearTimeout(timeout_);
              }
              timeout_ = setTimeout(function () {
                refresh(mapService);
              }, refreshTimeout);
            }
          };
          var metadata = layer.get('metadata');
          if (goog.isDefAndNotNull(metadata.isGeoGit) && metadata.isGeoGit === true) {
            if (goog.isDefAndNotNull(refreshed[metadata.repoId])) {
              doDiff(refreshed[metadata.repoId], metadata);
              nextLayer(nextIndex);
            } else if (!goog.isDefAndNotNull(notRefreshed[metadata.repoId])) {
              geogitService_.commitChanged(metadata.repoId).then(function (response) {
                if (response.changed === true) {
                  refreshed[metadata.repoId] = response;
                  doDiff(response, metadata);
                } else {
                  notRefreshed[metadata.repoId] = response;
                }
                nextLayer(nextIndex);
              }, function () {
                nextLayer(nextIndex);
              });
            } else {
              nextLayer(nextIndex);
            }
          }
        };
        processLayer(layers[0], 1);
      }
    }
    this.refreshLayers = function () {
      refresh(mapService_);
    };
  });
}());
(function () {
  var module = angular.module('loom_search_directive', []);
  module.directive('loomSearch', [
    '$timeout',
    '$translate',
    'searchService',
    'dialogService',
    'mapService',
    function ($timeout, $translate, searchService, dialogService, mapService) {
      return {
        restrict: 'C',
        replace: true,
        templateUrl: 'search/partial/search.tpl.html',
        link: function (scope) {
          scope.searchQuery = '';
          scope.searchInProgress = false;
          scope.searchResults = [];
          function zoomToResult(result) {
            var boxMin = ol.proj.transform([
                result.boundingbox[2],
                result.boundingbox[0]
              ], 'EPSG:4326', mapService.map.getView().getView2D().getProjection());
            var boxMax = ol.proj.transform([
                result.boundingbox[3],
                result.boundingbox[1]
              ], 'EPSG:4326', mapService.map.getView().getView2D().getProjection());
            var newBounds = [
                boxMin[0],
                boxMin[1],
                boxMax[0],
                boxMax[1]
              ];
            var x = newBounds[3] - newBounds[1];
            var y = newBounds[2] - newBounds[0];
            x *= 0.5;
            y *= 0.5;
            newBounds[1] -= x;
            newBounds[3] += x;
            newBounds[0] -= y;
            newBounds[2] += y;
            mapService.zoomToExtent(newBounds);
          }
          scope.clearResults = function () {
            scope.searchResults = [];
            $('#search-results-panel').collapse('hide');
            searchService.clearSearchLayer();
          };
          scope.displayingResults = function () {
            return scope.searchResults.length > 0;
          };
          scope.performSearch = function () {
            if (scope.displayingResults()) {
              scope.searchQuery = '';
              scope.clearResults();
              return;
            }
            if (scope.searchInProgress === true) {
              return;
            }
            $('#search-results-panel').collapse('hide');
            if (goog.string.removeAll(goog.string.collapseWhitespace(scope.searchQuery), ' ') !== '') {
              scope.searchInProgress = true;
              searchService.performSearch(scope.searchQuery).then(function (results) {
                scope.searchResults = results;
                if (results.length === 0) {
                  dialogService.open($translate.instant('search'), $translate.instant('search_no_results'));
                } else if (results.length === 1) {
                  zoomToResult(results[0]);
                  searchService.populateSearchLayer(results);
                } else {
                  $timeout(function () {
                    $('#search-results-panel').collapse('show');
                  }, 10);
                  searchService.populateSearchLayer(results);
                }
                scope.searchInProgress = false;
              }, function (_status) {
                scope.searchInProgress = false;
                scope.searchResults = [];
                if (goog.isDefAndNotNull(_status)) {
                  dialogService.error($translate.instant('search'), $translate.instant('search_error_status', { status: _status }));
                } else {
                  dialogService.error($translate.instant('search'), $translate.instant('search_error'));
                }
              });
            } else {
              scope.searchResults = [];
            }
          };
          scope.resultClicked = function (result) {
            zoomToResult(result);
          };
        }
      };
    }
  ]);
}());
