(function () {
  var module = angular.module('loom_statistics_service', []);
  var dialogService_ = null;
  var httpService_ = null;
  var tableViewService_ = null;
  var mapService_ = null;
  var q_ = null;
  var translate_ = null;
  module.provider('statisticsService', function () {
    this.$get = [
      '$q',
      '$http',
      'mapService',
      'dialogService',
      'tableViewService',
      '$translate',
      function ($q, $http, mapService, dialogService, tableViewService, $translate) {
        q_ = $q;
        httpService_ = $http;
        mapService_ = mapService;
        dialogService_ = dialogService;
        tableViewService_ = tableViewService;
        translate_ = $translate;
        return this;
      }
    ];
    this.summarizeAttribute = function (layer, filters, attributeName) {
      var deferredResponse = q_.defer();
      if (!goog.isDefAndNotNull(layer)) {
        deferredResponse.reject('Invalid Layer');
        return deferredResponse.promise;
      }
      var wfsPayload = tableViewService_.getFeaturesPostPayloadXML(layer, filters, null, null, null, true);
      console.log('wfsPayload: ', wfsPayload);
      if (!mapService_.layerIsEditable(layer)) {
        var url = layer.get('metadata').url + '/wps?version=' + settings.WPSVersion;
        var wpsPostData = '' + '<?xml version="1.0" encoding="UTF-8"?><wps:Execute version="' + settings.WPSVersion + '" service="WPS" ' + 'xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" ' + 'xmlns="http://www.opengis.net/wps/1.0.0" ' + 'xmlns:wfs="http://www.opengis.net/wfs" xmlns:wps="http://www.opengis.net/wps/1.0.0" ' + 'xmlns:ows="http://www.opengis.net/ows/1.1" xmlns:gml="http://www.opengis.net/gml" ' + 'xmlns:ogc="http://www.opengis.net/ogc" ' + 'xmlns:wcs="http://www.opengis.net/wcs/1.1.1" ' + 'xmlns:xlink="http://www.w3.org/1999/xlink" ' + 'xsi:schemaLocation="http://www.opengis.net/wps/1.0.0 ' + 'http://schemas.opengis.net/wps/1.0.0/wpsAll.xsd">' + '<ows:Identifier>py:summarize_attrib</ows:Identifier>' + '<wps:DataInputs>' + '<wps:Input>' + '<ows:Identifier>attributeName</ows:Identifier>' + '<wps:Data>' + '<wps:LiteralData>' + attributeName + '</wps:LiteralData>' + '</wps:Data>' + '</wps:Input>' + '<wps:Input>' + '<ows:Identifier>features</ows:Identifier>' + '<wps:Reference mimeType="text/xml" xlink:href="http://geoserver/wfs" method="POST">' + '<wps:Body>' + wfsPayload + '</wps:Body>' + '</wps:Reference>' + '</wps:Input>' + '</wps:DataInputs>' + '<wps:ResponseForm>' + '<wps:RawDataOutput>' + '<ows:Identifier>result</ows:Identifier>' + '</wps:RawDataOutput>' + '</wps:ResponseForm>' + '</wps:Execute>';
        httpService_.post(url, wpsPostData).success(function (data, status, headers, config) {
          if (typeof data == 'string' && data.indexOf('ProcessFailed') > -1) {
            deferredResponse.reject('Service Error');
            dialogService_.error(translate_.instant('error'), translate_.instant('error'));
          } else {
            var stats = {};
            stats.fieldname = attributeName;
            stats.statistics = {};
            goog.object.extend(stats.statistics, data);
            deferredResponse.resolve(stats);
          }
        }).error(function (data, status, headers, config) {
          console.log('----[ Warning: StatisticsService.summarizeAttribute error', data, status, headers, config);
          deferredResponse.reject('Service Error');
        });
      } else {
        deferredResponse.reject('Invalid layer type');
      }
      return deferredResponse.promise;
    };
  });
}());
(function () {
  var module = angular.module('loom_addsync_directive', []);
  module.directive('loomAddsync', [
    '$translate',
    'synchronizationService',
    'geogitService',
    'dialogService',
    '$q',
    function ($translate, synchronizationService, geogitService, dialogService, $q) {
      return {
        templateUrl: 'sync/partials/addsync.tpl.html',
        link: function (scope, element) {
          scope.geogitService = geogitService;
          scope.name = $translate.instant('link');
          scope.$on('translation_change', function () {
            scope.name = $translate.instant('link');
          });
          scope.createLink = function (name, repo, remote, localBranch, remoteBranch) {
            synchronizationService.addLink(new SynchronizationLink(name, repo, localBranch, remote, remoteBranch));
          };
          var reset = function () {
            scope.name = $translate.instant('link');
            scope.selectedRepo = null;
            scope.selectedRemote = null;
            scope.localBranch = null;
            scope.remoteBranch = null;
          };
          scope.dismiss = function () {
            reset();
            element.closest('.modal').modal('hide');
          };
          var parentModal = element.closest('.modal');
          var closeModal = function (event, element) {
            if (parentModal[0] === element[0]) {
              reset();
            }
          };
          scope.$watch('selectedRemote', function () {
            if (goog.isDefAndNotNull(scope.selectedRemote)) {
              if (scope.selectedRemote.branches.length === 0) {
                dialogService.open($translate.instant('fetch'), $translate.instant('remote_not_fetched'), [$translate.instant('btn_ok')], false).then(function (button) {
                  switch (button) {
                  case 0:
                    element.find('#loading').toggleClass('hidden');
                    var fetchResult = $q.defer();
                    var fetchOptions = new GeoGitFetchOptions();
                    fetchOptions.remote = scope.selectedRemote.name;
                    geogitService.command(scope.selectedRepo.id, 'fetch', fetchOptions).then(function () {
                      geogitService.loadRemotesAndBranches(scope.selectedRepo, fetchResult);
                      fetchResult.promise.then(function () {
                        element.find('#loading').toggleClass('hidden');
                      });
                    }, function (error) {
                      var message = $translate.instant('fetch_error');
                      if (error.status == '408' || error.status == '504') {
                        message = $translate.instant('fetch_timeout');
                      }
                      dialogService.error($translate.instant('fetch'), message, [$translate.instant('btn_ok')], false);
                      element.find('#loading').toggleClass('hidden');
                    });
                  }
                });
              }
            }
          });
          scope.$on('repoRemoved', reset);
          scope.$on('modal-closed', closeModal);
          scope.$on('loadLink', function (event, link) {
            $('#addSyncWindow').modal('toggle');
            scope.name = link.name;
            scope.selectedRepo = link.getRepo();
            scope.selectedRemote = link.getRemote();
            scope.localBranch = link.getLocalBranch();
            scope.remoteBranch = link.getRemoteBranch();
          });
        }
      };
    }
  ]);
}());
